import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";

const Login = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await authService.login(form);
      console.log("‚úÖ LOGIN RESULT:", res.data);

      const loginData = res.data;

      // ‚úÖ L·∫§Y TOKEN T·ª™ 'jwt-token'
      const token = loginData['jwt-token'];

      if (!token) {
        console.error("‚ùå No jwt-token found in response:", loginData);
        throw new Error("No token received from server");
      }

      // ‚úÖ L∆ØU TOKEN
      localStorage.setItem("token", token);
      console.log("üîê Token saved");

      // ‚úÖ T√åM USER ID TH·∫¨T - QUAN TR·ªåNG!
      let realUserId = null;

      // C√°ch 1: T·ª´ login response
      if (loginData.userId || loginData.user_id) {
        realUserId = loginData.userId || loginData.user_id;
        console.log("‚úÖ Got user ID from login response:", realUserId);
      }
      // C√°ch 2: T·ª´ user object trong response
      else if (loginData.user && (loginData.user.userId || loginData.user.user_id)) {
        realUserId = loginData.user.userId || loginData.user.user_id;
        console.log("‚úÖ Got user ID from user object:", realUserId);
      }
      // C√°ch 3: G·ªçi API /auth/me ƒë·ªÉ l·∫•y user info
      else {
        console.log("üîç No user ID in login response, calling /auth/me...");
        try {
          const userInfoResponse = await fetch('http://localhost:8080/api/auth/me', {
            method: 'GET',
            headers: {
              'Authorization': `Bearer ${token}`,
              'Content-Type': 'application/json'
            }
          });

          if (userInfoResponse.ok) {
            const userInfo = await userInfoResponse.json();
            realUserId = userInfo.userId || userInfo.user_id;
            console.log("‚úÖ Got user ID from /auth/me:", realUserId);
          } else {
            console.warn("‚ö†Ô∏è /auth/me failed, status:", userInfoResponse.status);
          }
        } catch (meError) {
          console.warn("‚ö†Ô∏è /auth/me endpoint error:", meError);
        }
      }

      // ‚úÖ N·∫æU V·∫™N KH√îNG C√ì USER ID TH·∫¨T, KH√îNG CHO ƒêƒÇNG NH·∫¨P
      if (!realUserId) {
        console.error("‚ùå CRITICAL: No real user ID found after login");
        localStorage.removeItem("token");
        throw new Error("Kh√¥ng th·ªÉ l·∫•y th√¥ng tin ng∆∞·ªùi d√πng. Vui l√≤ng th·ª≠ l·∫°i.");
      }

      // ‚úÖ L∆ØU USER DATA V·ªöI USER ID TH·∫¨T
      const userToStore = {
        userId: realUserId,
        email: form.email,
        first_name: loginData.first_name || loginData.firstName || "",
        last_name: loginData.last_name || loginData.lastName || ""
      };

      localStorage.setItem("user", JSON.stringify(userToStore));
      console.log("üíæ User data saved with REAL ID:", userToStore);

      // ‚úÖ KI·ªÇM TRA L·∫†I
      const savedToken = localStorage.getItem("token");
      const savedUser = JSON.parse(localStorage.getItem("user"));

      console.log("üîç FINAL AUTH CHECK:", {
        token: savedToken ? "EXISTS" : "MISSING",
        user: savedUser ? `EXISTS (ID: ${savedUser.userId})` : "MISSING",
        isTempId: savedUser && savedUser.userId.toString().startsWith('temp_')
      });

      if (!savedToken || !savedUser || savedUser.userId.toString().startsWith('temp_')) {
        localStorage.clear();
        throw new Error("D·ªØ li·ªáu ƒëƒÉng nh·∫≠p kh√¥ng h·ª£p l·ªá");
      }

      alert("‚úÖ ƒêƒÉng nh·∫≠p th√†nh c√¥ng!");

      // ‚úÖ CHUY·ªÇN TRANG
      setTimeout(() => {
        window.location.href = "/";
      }, 500);

    } catch (err) {
      console.error("‚ùå LOGIN ERROR:", err);
      localStorage.clear();
      alert("‚ùå ƒêƒÉng nh·∫≠p th·∫•t b·∫°i: " + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="card mx-auto" style={{ maxWidth: "380px", marginTop: "100px" }}>
      <div className="card-body">
        <h4 className="card-title mb-4">Sign in</h4>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              name="email"
              className="form-control"
              placeholder="Email"
              type="email"
              value={form.email}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-group">
            <input
              name="password"
              className="form-control"
              placeholder="Password"
              type="password"
              value={form.password}
              onChange={handleChange}
              required
            />
          </div>

          <button type="submit" className="btn btn-primary btn-block">
            Login
          </button>
        </form>
      </div>
    </div>
  );
};

export default Login;
